mappages["beldskae"].onload = function(mapref) {
  if ((gamestate.getMode() !== "loadgame") && (!DU.gameflags.getFlag("editor"))) {

    CheckForCourier(mapref, 27, 33, 28, 39);
    // Changes made due to schedules

    let kalli;

    let npcs = mapref.npcs.getAll();

    for (let i=0;i<npcs.length;i++) {
      if (npcs[i].getNPCName() === "Kalli") { kalli = npcs[i]; }
    }

    if ((kalli.getCurrentScheduleIndex() >= 32) && (kalli.getCurrentScheduleIndex() < 1)) {
      kalli.setGraphic("paladin-offcolor.gif");
    }

    let sstile = mapref.getTile(22,12).getFeatures();
    for (let i=0;i<sstile.length;i++) {
      if (sstile[i].getName() === "Shortsword") {
        sstile[i].noTake = 1;
        sstile[i].prompt =1 ;
        sstile[i].karmaPenalty = 1;
      }
    }
  }
}

